import React, { useState } from 'react';
import Student from './Student';
const App = () => {

  const [data,setdata]=useState("");

  const getdata=(e)=>{
    e.target.value();
  }

  const submit=(e)=>{
    setdata(data);
  }

  return (
  <>
<h1>`hello muhammad adil + ${data} `</h1>

<input type="text" onChange={getdata}  value={data}/>
<button onClick={submit}>click</button>







<Student no={1}    name={ "qasim"}  email={'qasim@gmail.com'}/>
<Student no={2}   name={ "adil"}  email={'adil@gmail.com'}/>
<Student no={3}   name={ "inam"}  email={'inam@gmail.com'}/>
  </>
    );
};

export default App;
